import React from 'react';
import Card from '../UI/Card';
import classes from './Navigation.module.css';

const Navigation = (props) => {
    return (
        <nav className={classes.nav}>
            <a href='#'>Home</a>
            <a href='#'>API</a>
            <a href='#'>Sign in</a>
        </nav>
    );
};

export default Navigation;
